import org.apache.commons.net.PrintCommandListener;
import org.apache.commons.net.io.Util;
import org.apache.commons.net.smtp.SMTPClient;
import org.apache.commons.net.smtp.SMTPReply;
import org.apache.commons.net.smtp.SimpleSMTPHeader;
public final class SMTPMail
{
    public static void main(String[] args)
    {
        String sender, recipient, subject, filename, server, cc;
        List<String> ccList = new ArrayList<String>();
        BufferedReader stdin;
        FileReader fileReader = null;
        Writer writer;
        SimpleSMTPHeader header;
        SMTPClient client;
        if (args.length < 1)
        {
            System.err.println("Usage: mail smtpserver");
            System.exit(1);
        }
        server = args[0];
        stdin = new BufferedReader(new InputStreamReader(System.in));
        try
        {
            System.out.print("From: ");
            System.out.flush();
            sender = stdin.readLine();
            System.out.print("To: ");
            System.out.flush();
            recipient = stdin.readLine();
            System.out.print("Subject: ");
            System.out.flush();
            subject = stdin.readLine();
            header = new SimpleSMTPHeader(sender, recipient, subject);
            while (true)
            {
                System.out.print("CC <enter one address per line, hit enter to end>: ");
                System.out.flush();
                cc = stdin.readLine();
                if (cc== null || cc.length() == 0) {
                    break;
                }
                header.addCC(cc.trim());
                ccList.add(cc.trim());
            }
            System.out.print("Filename: ");
            System.out.flush();
            filename = stdin.readLine();
            try
            {
                fileReader = new FileReader(filename);
            }
            catch (FileNotFoundException e)
            {
                System.err.println("File not found. " + e.getMessage());
            }
            client = new SMTPClient();
            client.addProtocolCommandListener(new PrintCommandListener(
                                                  new PrintWriter(System.out), true));
            client.connect(server);
            if (!SMTPReply.isPositiveCompletion(client.getReplyCode()))
            {
                client.disconnect();
                System.err.println("SMTP server refused connection.");
                System.exit(1);
            }
            client.login();
            client.setSender(sender);
            client.addRecipient(recipient);
            for (String recpt : ccList) {
                client.addRecipient(recpt);
            }
            writer = client.sendMessageData();
            if (writer != null)
            {
                writer.write(header.toString());
                Util.copyReader(fileReader, writer);
                writer.close();
                client.completePendingCommand();
            }
            if (fileReader != null ) {
                fileReader.close();
            }
            client.logout();
            client.disconnect();
        }
        catch (IOException e)
        {
            e.printStackTrace();
            System.exit(1);
        }
    }
}

package org.apache.commons.net.examples.mail;
import java.io.BufferedReader;
import java.io.Console;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.Locale;
class Utils {
    private Utils() {
    }
    static String getPassword(String username, String password) throws IOException {
        if ("-".equals(password)) { // stdin
            BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
            password = in.readLine();
        } else if ("*".equals(password)) { // console
            Console con = System.console(); // Java 1.6
            if (con != null) {
                char[] pwd = con.readPassword("Password for " + username + ": ");
                password = new String(pwd);
            } else {
                throw new IOException("Cannot access Console");
            }
        } else if (password.equals(password.toUpperCase(Locale.ROOT))) { // environment variable name
            final String tmp = System.getenv(password);
            if (tmp != null) { // don't overwrite if variable does not exist (just in case password is all uppers)
                password=tmp;
            }
        }
        return password;
    }
}

